import 'dart:async';
import 'dart:convert';
import 'package:flutter/foundation.dart';
import 'package:flutter/material.dart';
import 'package:petbond_uk/core/routes/routes.dart';
import 'package:petbond_uk/core/services/secure_storage.dart';
import 'package:petbond_uk/core/widgets/base_widget.dart';
import 'package:webview_flutter/webview_flutter.dart';
import 'package:petbond_uk/core/widgets/globals.dart' as globals;

class SplashScreen extends StatefulWidget {
  final double? width;
  final double? height;

  const SplashScreen({
    Key? key,
    this.width,
    this.height,
  }) : super(key: key);

  @override
  _SplashScreenState createState() => _SplashScreenState();
}

class _SplashScreenState extends State<SplashScreen> {
  final SecureStorage _secureStorage = SecureStorage();
  final _key = UniqueKey();

  @override
  void initState() {
    super.initState();
    _checkVerifyEmail();
    _checkOnBoard();
    _checkTransferUnable();
    _land();
  }

  _checkVerifyEmail() {
    _secureStorage.readStore("email_verified").then((value) {
      if (value == null) {
        globals.GlobalData.showVerifyPopUp = true;
      } else {
        globals.GlobalData.showVerifyPopUp = false;
      }
    });
  }

  _checkOnBoard() {
    _secureStorage.readStore("onBoard_status").then((value) {
      if (value == "false") {
        globals.GlobalData.showStripeAccountPopUp = true;
      } else {
        globals.GlobalData.showStripeAccountPopUp = false;
      }
    });
  }

  _checkTransferUnable() {
    _secureStorage.readStore("transferUnable").then((value) {
      if (value == "false") {
        globals.GlobalData.showTransferUnablePopUp = true;
      } else {
        globals.GlobalData.showTransferUnablePopUp = false;
      }
    });
  }

  _land() {
    SecureStorage _secureStorage = SecureStorage();
    _secureStorage.readStore('token').then((token) {
      _secureStorage.readStore('role').then((role) {
        switch (role) {
          case 'breeder':
            Timer(
                const Duration(seconds: 4),
                () => Navigator.pushNamedAndRemoveUntil(
                    context, breederDashBoardScreen, (route) => false));
            break;
          case 'veterinarian':
            Timer(
                const Duration(seconds: 4),
                () => Navigator.pushNamedAndRemoveUntil(
                    context, vetDashBoardScreen, (route) => false));
            break;
          case 'charity':
            Timer(
                const Duration(seconds: 4),
                () => Navigator.pushNamedAndRemoveUntil(
                    context, charityDashBoardScreen, (route) => false));
            break;
          default:
            Timer(
                const Duration(seconds: 6),
                () => Navigator.pushNamedAndRemoveUntil(
                    context, loginScreen, (route) => false));
            break;
        }
      });
    });
  }

  @override
  Widget build(BuildContext context) {
    return BaseWidget(
      builder: (context, sizingInformation) {
        if (kIsWeb || (defaultTargetPlatform != TargetPlatform.android && defaultTargetPlatform != TargetPlatform.iOS)) {
          return const Text(
            "SVGator's Flutter animations run only on Android or iOS",
            textAlign: TextAlign.center,
          );
        } else {
          return SizedBox(
              width: widget.width,
              height: widget.height,
              child: WebView(
                key: _key,
                javascriptMode: JavascriptMode.unrestricted,
                initialUrl: 'about:blank',
                onWebViewCreated: (WebViewController webViewController) {
                  _loadHtmlFromAssets(webViewController);
                },
              ));
        }
      },
    );
  }

